Create FUNCTION [dbo].[getRandomName]
(@nameType int)
RETURNS  nvarchar(MAX)
AS
BEGIN

return (select top 1 name from RandomNames where nameType = @nameType order by (SELECT [MyNewId] FROM Get_NewID))
END
GO

