Create FUNCTION [dbo].[getSocialSec]
(@socsec          nvarchar(5))
RETURNS  nvarchar(MAX)

AS
BEGIN
return (select top 1 name from RandomSocSec where name like @socsec+'%'  or [name] = '19631201-2534'  order by (SELECT [MyNewId] FROM Get_NewID))
END
