    SELECT DataStorageRecordId FROM #tempDataStorage
 
OPEN CUR_TEST
FETCH NEXT FROM CUR_TEST INTO @DataStorageRecordId
 
WHILE @@FETCH_STATUS = 0
BEGIN
   --select @DataStorageRecordId
   
   select ActorCompanyId,Type,'TestFile.jpg', UserId,OriginType, 'TestDescription',  from #tempDataStorage where DataStorageRecordId = @DataStorageRecordId

   select @DataStorageId = SCOPE_IDENTITY()
   --select @DataStorageId

   select @DataStorageId,Type,Entity, RecordId from #tempDataStorage where DataStorageRecordId = @DataStorageRecordId

   FETCH NEXT FROM CUR_TEST INTO @DataStorageRecordId
END
CLOSE CUR_TEST
